import { ReactComponent as Logo } from './Logo.svg';
import './FooterComp.css';

function FooterComp() {
    return(
        <div class="footer">
            <div class="footer-logo">
                <Logo className="lemon"/>
            </div>
            <div class="footer-menu">

            </div>
            <div class="footer-contact">

            </div>
            <div class="footer-socials">

            </div>
        </div>
    )
}
export default FooterComp;
